function createAccount(arr){
  var 
    ans = [], 
    innerarr;

  for(var i = 0; i<arr.length; i++){
    ans.push({
      'name': arr[i][0].account,
      'data':[],
      'visible': i===0? true: false
    })

    innerarr = arr[i];
    for(var j =0; j<innerarr.length; j++){
      var a  = innerarr[j];
      var d  = new Date(a.month + ' '+ a.date + ', 2015');
      ans[i].data.push([d.getTime(), +a.balance]);
    }
  }
  return ans;
}

