function sortValues(jsondata, callback){
  var sortedarrays = [];

  for(var i = 0; i<jsondata.values.length; i++){
    sortedarrays.push(
      jsondata.values[i]
      .map(function(a){
        //Zero indexed dates are incompatible with JS Date object
        a.date = +a.date;
        a.date+=1;
        return a;
      })
      .sort(function(a, b) {
        //Sort by date
         a = new Date(a.month + ' '+ a.date + ', 2015');
         b = new Date(b.month + ' ' + b.date + ', 2015');
         return a - b;
        })
      );
  }
  sortedData = callback(sortedarrays);
  return sortedData;
}